import Pokemon from "../pokemon/Pokemon";

export default function Pokemons() {
  const getPokemons = useDispatch(getPokemons());

  const state = useSelector((state) => state.allPokemons);

  useEffect(() => {
    //cargo los pokes en el estado cuando se monta el componente
    getPokemons();
  }, []);

  return (
    <div>
      <Pokemon />
    </div>
  );
}
